import React from 'react';
import styled from "styled-components";
import Search from '../board/search';
import Gather from '../board/gather';

const Wrapper = styled.section`
  width: 1200px;
  margin: 0 auto;
`

const Section = (props) => {
  return (
    <>
      <Search />
      <Gather />
    </>
  )
};

export default Section;
